import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';

const Navbare = () => {

  return (
    <div>
      <div style={{ height: '72px' }}></div> {/* espace réservé pour la barre de navigation */}
      <Navbar bg="light" expand="lg" fixed="top">
        <Container>
          <Navbar.Brand href="#" style={{color:'blue',fontSize:'40px',marginRight: '700px'}}>E-Tafa</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <NavLink to="/accueil" style={{color: 'black', fontSize:'20px',textDecoration: 'none', borderBottom: 'none',marginRight: '40px'}}>
                Accueil
              </NavLink>
              <NavLink to="/Message" style={{color: 'black',fontSize:'20px', textDecoration: 'none', borderBottom: 'none',marginRight: '40px'}}>
                Message
              </NavLink>
              <NavLink to="/Contact"style={{color: 'black',fontSize:'20px', textDecoration: 'none', borderBottom: 'none',marginRight: '40px'}}>
                Contact
              </NavLink>
              <NavLink to="/A propos"style={{color: 'black',fontSize:'20px', textDecoration: 'none', borderBottom: 'none',marginRight: '40px'}}>
                A propos
              </NavLink>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
}

export default Navbare;
